import ExpensItem from "./ExpenseItem";
function DisplayExpenses() {
  return (
    <div>
      <ExpenseItem
        title={expense[0].title}
        amount={expense[0].amount}
        date={expense[0].date}
      />
      e={expense[2].date}
      />
    </div>
  );
}

export default DisplayExpenses;
